import axios from 'axios'
import React, { useEffect, useState } from 'react'
import EquitiesTableView from './EquitiesTableView'


const GetAllEquities = () => {
    const [equities, setEquities] = useState([])

    useEffect(() => {
        axios.get(`https://localhost:7126/api/Equities/`)
            .then(res => {
                console.log(res.data)
                setEquities(res.data)
            })
            .catch(error => {
                console.log(error.message)
            })
    }, [])

    var info = equities.map(equity => <EquitiesTableView equity={equity}/>)

    const columns = Object.keys(equities[0]).map((key) => ({
      accessorKey: key,
      header: key.replace(/([A-Z])/g, ' $1').replace(/^./, (str) => str.toUpperCase()),
    }));
    
  return (
    <div>
      <h2>All Equities</h2>
      {info}
    </div>
  )
}

export default GetAllEquities
